CREATE TABLE TB_TMP_ORDER (
	ORD_ID INT NOT NULL,
	GOOD_ID INT NOT NULL,
	ORD_AMT INT DEFAULT 0,
	ETR_DATE TIMESTAMP(6) DEFAULT current_timestamp,
	UPDATE_DATE TIMESTAMP(6),
	ERP_ORDER_ID INT,
	ERP_TRANS_DATE TIMESTAMP(6)
)
;

COMMENT ON TABLE TB_TMP_ORDER IS '주문';

COMMENT ON COLUMN TB_TMP_ORDER.ORD_ID IS '주문번호';

COMMENT ON COLUMN TB_TMP_ORDER.GOOD_ID IS '상품번호';

COMMENT ON COLUMN TB_TMP_ORDER.ORD_AMT IS '주문액';

COMMENT ON COLUMN TB_TMP_ORDER.ETR_DATE IS '입력일자';

COMMENT ON COLUMN TB_TMP_ORDER.UPDATE_DATE IS '수정일자';

COMMENT ON COLUMN TB_TMP_ORDER.ERP_ORDER_ID IS 'ERP주문번호';

COMMENT ON COLUMN TB_TMP_ORDER.ERP_TRANS_DATE IS 'ERP전송일자';


ALTER TABLE TB_TMP_ORDER ADD CONSTRAINT PK_TB_TMP_ORDER
PRIMARY KEY (
	ORD_ID
);

ALTER TABLE TB_TMP_ORDER ADD 
CHECK (ORD_ID IS NOT NULL);

ALTER TABLE TB_TMP_ORDER ADD 
CHECK (GOOD_ID IS NOT NULL);


